  return (
    <div className="App">
      <div className="black-nav">
        <div>개발 Blog</div>        
      </div>

      <h4>{titles[0]}{contents[0]}</h4>
      <h4>{titles[1]}</h4>
      <h4>{titles[2]}</h4>
    </div>
  );
}

